import React from 'react';
import './Instructor.css';

const Instructor = () => {
    return (
        <div className="instructor-container">
            <h1>Instructor Dashboard</h1>
            <div className="instructor-content">
                <div className="instructor-section">
                    <h2>My Courses</h2>
                    <button className="instructor-btn">Create New Course</button>
                    <button className="instructor-btn">View My Courses</button>
                    <button className="instructor-btn">Update Course</button>
                </div>
                <div className="instructor-section">
                    <h2>Student Management</h2>
                    <button className="instructor-btn">View Students</button>
                    <button className="instructor-btn">Grade Assignments</button>
                    <button className="instructor-btn">Send Announcements</button>
                </div>
                <div className="instructor-section">
                    <h2>Analytics</h2>
                    <button className="instructor-btn">Course Performance</button>
                    <button className="instructor-btn">Student Progress</button>
                </div>
            </div>
        </div>
    );
};

export default Instructor;
